import './App.css';
import Nav from './cmpo/Nav.js';
import Footer from './cmpo/Footer.js';
import Logo from './cmpo/Logo.js';
import Home from './pages/Home.js';
function App() {
  return (
    <>
      <header  className="App">
      <Logo/>


      </header>

      <Nav/>

      <Home/>

      <Footer/>


    </>

  );
}

export default App;
